window.bookSummaryJSON = "<p>Lawrence is having a shitty day. His girlfriend is not only cheating on him but she’s cheating on him with his best friend. He had the added benefit of finding out about it firsthand. To make matters worse a legendary native American God has sent him back to North America circa AD 1400. What’s a gamer to do?</p> <p>From the creator of the hilarious Eryth online and the action packed warrior academy series comes <i>I Am Gamer</i>!</p> <p>This is the first book in a series that will span continents. Join our hero on his journey to unify the Americas and fight back against its foreign invaders. Using skills and knowledge from the future all revealed in a game type format, Lawrence Lawrence Wrath will save the world...or die trying....</p>"; 
